	@Override
	public  List<String> writeImgReadilyShoot(String reportSerialNumber, List<String> base64Imgs)throws Exception {
		String baseUrl = "http://szjj.u-road.com/fileserver/img/";
		List<String> imgPaths = new ArrayList<String>();
		//序列号为文件夹名称
		//日期+数字
		String basePath = "/opt/file/img";
		//String basePath = "D:\\opt";
		File file = new File(basePath + "/" + reportSerialNumber);
		file.setWritable(true, false);
		if(!file.exists()){
			file.mkdirs();
		}
		if(null != base64Imgs && base64Imgs.size() > 0){
			for(String baseStr : base64Imgs){
				String random = RandomUtil.randomString(5);
				Long long1 = System.currentTimeMillis();
				String path = basePath + "/" + reportSerialNumber + "/" + long1 + random + ".jpg";
				String imgPath = reportSerialNumber + "/" + long1 + random + ".jpg";
				boolean flag = generateImage(baseStr, path);
				if(flag){
					imgPaths.add(baseUrl + imgPath);
				}
			}
		}
		return imgPaths;
	}
	/**
	 * base64转成图片地址
	 * @param base64Str
	 * @param path
	 * @return
	 */
	public static boolean generateImage(String base64Str, String path) {
		if (base64Str == null)
			return false;
		try {
			// 解密
			byte[] b = Base64.decodeBase64(base64Str);
			// 处理数据
			for (int i = 0; i < b.length; ++i) {
				if (b[i] < 0) {
					b[i] += 256;
				}
			}
			OutputStream out = new FileOutputStream(path);
			out.write(b);
			out.flush();
			out.close();
			return true;
		} catch (Exception e) {
			return false;
		}
	}
	/**
	 * 图片转成base64
	 * @param imgFile
	 * @return
	 */
	public static String getImageStr(String imgFile) {
	    InputStream inputStream = null;
	    byte[] data = null;
	    try {
	        inputStream = new FileInputStream(imgFile);
	        data = new byte[inputStream.available()];
	        inputStream.read(data);
	        inputStream.close();
	    } catch (IOException e) {
	        e.printStackTrace();
	    }
	    // 加密
	    return Base64.encodeBase64String(data);
	}

